import React, { Component } from "react";
import usericon from "../img/nav_usericon.png";
import navlogo from "../img/nav-logo.svg";
import "../css/navbar.css";

class Navbar extends Component {
  state = {
    logo: navlogo,
    usericon: usericon,
    username: "Username",
    usermail: "username@mail.com",
  };

  render() {
    return (
      <div className="nav">
        <div className="content-aligner">
        <div className="logo">
          <img src={this.state.logo} alt="Pict-CodeLab" className="navlogo" />
        </div>
        <div className="nav-user-details">
          <img
            src={this.state.usericon}
            alt={this.state.username}
            className="nav-user-icon"
          />
          <div className="user-text-details">
              <p id="username">{this.state.username}</p>
              <p id="usermail">{this.state.usermail}</p>
          </div>
        </div>
        </div>

      </div>
    );
  }
}

export default Navbar;
